import { makeStyles } from "@material-ui/core/styles";

export default function DashboardPage() {
  return (
    <Grid container>
      <Grid item xs={12}>
        <Typography variant="body1" component="div">
          Bem vindo!
        </Typography>
      </Grid>
      <Grid item xs={2}></Grid>
      <Grid item xs={10}></Grid>
    </Grid>
  );
}
